app1.controller("NewValueCtrl",["$scope","$mdDialog","SessionService","DesignValue",function(e,o,s,t){e.sessionData=s.getSessionData(),e.$watch(function(){return s.getSessionData()},function(o,s){o!=s&&(e.sessionData=o)}),e.values=[],e.values.push({id:"",translated_name:e.sessionData.appData.new_value}),e.value_id,t.query({skip:0,limit:500},function(o){for(var t=0;t<o.length;t++)e.values.push({id:o[t]._id,translated_name:s.translate(o[t].name)})}),e.hide=function(){o.hide()},e.cancel=function(){o.cancel()},e.answer=function(e){o.hide(e)}}]);
